import React from "react";
import { Todo } from "../models/Todo";
import TodoItem from "./TodoItem";

interface Props {
  items: Todo[];
  removeTodo: (id: string) => void;
}

export const Todos: React.FC<Props> = (props) => {
  return (
    <ul>
      {props.items.map((item) => {
        return (
          <TodoItem
            key={item.id}
            text={item.text}
            id={item.id}
            removeTodo={props.removeTodo}
          />
        );
      })}
    </ul>
  );
};
